import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">
      <div class="container">
        <div class="navbar"> 
          <div class="navbar-left">
            <a class="habit-rabbit top-right l-9">Habbit Rabbit</a>
          </div>
          <div class="navbar-right">
            <a class="nav-button right-align p-sm-2">Home</a>
            <a class="home-button right-align p-sm-2">About</a>
            <a class="home-button right p-sm-2">Sign In</a>
          </div>
        </div>
      </div>  
    </div>
  );
}

export default App;
